import styles from "./AdminEditor.module.css"


const AdminEditor = () => {
    return (
        <Fragment>
            <h2>New Blog Post</h2>
            <textarea className={`${styles['blog-area']}`} name="BlogArea" id="" cols="100" rows="10"></textarea>
        </Fragment>
    )
}

export default AdminEditor;
